import React from 'react';
import Link from 'next/link';

const indexPage = () => (
    <div>
        <h1>The Main Page</h1>
        <p>Goto <Link href="/auth"><a>Auth</a></Link></p>
        <button>Got</button>
    </div>
);

export default indexPage;
